          "colorTheme": "#48351c",
          "description": "Ботинки Dr. Martens 1460 Black Sabbath обладают следующими особенностями:\n- Отмечают 50-летие дебютного альбома группы Black Sabbath.\n- Имеют уникальные принты с дебютного альбома группы, отражающие их влияние на музыкальные сцены.\n- Изготовлены из кожи Backhand Straw Grain, которая является полнозерновой кожей с текстурой соломы.\n- Оснащены восьмью металлическими люверсами для шнуровки.\n- Имеют традиционную жёлтую строчку Dr. Martens и петлю на пятке Air Wair.\n- Подошва с технологией Goodyear, которая термозапаяна и имеет воздушную подушку для комфорта.\n- Предназначены для любителей музыки и культурного наследия, а также для тех, кто ценит уникальный стиль и качество.",
