          "colorTheme": "#ece0cf",
          "description": "New Balance NB 2002R CNY обладает следующими особенностями:\n- Отмечает Китайский Новый Год с дизайном, вдохновленным годом Кролика.\n- Верх выполнен из замши и сетки с добавлением кожаных деталей.\n- Сочетает в себе классический стиль и улучшенные технологии амортизации.\n- Предназначены для любителей ретро-стиля и винтажной моды.\n- Подходят для повседневного ношения благодаря удобной и стабильной конструкции.\n- Включают в себя элементы дизайна, направленные на повышение стабильности и поддержки стопы.\n- Предлагают защиту и комфорт, что делает их подходящими для холодной погоды.\n- Имеют прочную верхнюю часть, обеспечивающую долговечность обуви.\n- Подошва вдохновлена беговыми моделями, что придает кроссовкам спортивный вид.\n- Представлены в различных цветовых вариантах, сочетающих классические и современные элементы.",
