          "colorTheme": "#e7d0c3",
          "description": "Кроссовки adidas originals FORUM Low 84 обладают следующими особенностями:\n- Вдохновлены баскетбольной обувью 80-х годов, сочетая в себе спортивный стиль и уличную моду.\n- Изготовлены из премиальной кожи с элементами из переработанного полиэстера, подчеркивающими экологичность бренда.\n- Оснащены резиновой подошвой, обеспечивающей надежное сцепление с поверхностью.\n- Предназначены для активных людей, включая спортсменов и энтузиастов спорта.\n- Отличаются увеличенной прочностью верха и умеренной долговечностью, подходят для ношения в различных условиях.\n- Обладают поддерживающим и хорошо амортизирующим дизайном, что делает их удобными для длительного ношения.\n- Имеют дизайн, который не ограничивает движения и не ухудшает вентиляцию, благодаря чему обувь \"дышит\".\n- Предлагаются в различных цветовых решениях, включая оттенки зеленого и розового, что делает их привлекательными для широкой аудитории.",
          "primarySizeType": "EU",
