          "colorTheme": "#1f2a39",
          "description": "Air Jordan 13 Retro \"Obsidian\" обладает следующими особенностями:\n- Оборудованы технологией амортизации Nike Air, обеспечивающей смягчение ударов и поддержку.\n- Являются символом стиля, качества и уникальности благодаря богатой истории бренда Air Jordan.\n- Предназначены для любителей бренда Air Jordan, коллекционеров и ценителей качественной обуви.\n- Отличаются уникальным дизайном, премиальными материалами и вниманием к деталям.\n- Представляют собой коллекционный предмет, выделяющийся среди других моделей.\n- Разработаны специально для баскетбола и широко используются как любителями, так и профессиональными игроками.\n- Включают в себя высококачественные материалы и дизайн, а также ассоциируются с Майклом Джорданом и брендом Jordan.\n- Обеспечивают комфорт и ориентированы на производительность благодаря таким особенностям, как технология амортизации Nike Air и дышащие ткани.",
